@-moz-document url-prefix("https://en.help.roblox.com/"), url-prefix("http://en.help.roblox.com/"), url-prefix("http://careers.roblox.com/"), url-prefix("http://careers.roblox.com/")
{
/* ROBLOX Support */
  #header
  {
    background-color: #0074bd;
    height: 40px;
  }
/* Logo */
  .logo img
  {
    width: 0;
    max-height: 30px;
  }

  .logo a::after
  {
    display: inline-block;
    background-image: url(data:image/svg+xml;base64,);
    background-size: 100%;
    background-repeat: no-repeat;
    content: 'invisible';
    font-size: 0;
    width: 120px;
    height: 30px;
    position: absolute;
    left: 6px;
    top: 6px;
  }
}
